CREATE FUNCTION public.promjena_clanstva() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
BEGIN
UPDATE clanstvo
SET vrijedece_vrijeme = tsrange(
LOWER( vrijedece_vrijeme )::TIMESTAMP,
NOW()::TIMESTAMP )
WHERE OLD.clan = clan
AND OLD.grupa = grupa
AND UPPER( vrijedece_vrijeme ) = 'infinity'::TIMESTAMP;
RETURN NULL;
END;
$$;


