CREATE FUNCTION public.veza_prihvacena() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
DECLARE postoji BOOLEAN;
BEGIN
IF NEW.status = 'prihvaceno' THEN
postoji := EXISTS(
SELECT veza
FROM veza
WHERE poslao = NEW.prihvatio
AND prihvatio = NEW.poslao
AND vrsta = NEW.vrsta
);
IF NOT postoji THEN
INSERT INTO veza
VALUES ( NEW.prihvatio, NEW.poslao,
NEW.vrsta, 'prihvaceno' );
END IF;
END IF;
RETURN NEW;
END;
$$;


